import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import Home from "./Home";
import Header from './Components/Header'
import Start from "./Start";

function Main() {
  return (
      <HashRouter>
        <div>
          <Header/>
          <ul className="header">
            <li><a href="/">Home</a></li>
            <li><a href="/stuff">Stuff</a></li>
            <li><a href="/contact">Contact</a></li>
          </ul>
          <div className="content">

          </div>
        </div>
        </HashRouter>

  )
}


export default Main;
